import React,{useEffect} from 'react';
import {Card} from '@material-ui/core';
import {useStyles} from '../../styles/styles';
import {useDispatch, useSelector} from 'react-redux';
import {LoadProfileAction} from '../../redux/actions/ProfileActions';
import {Link } from "react-router-dom";
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography'

export default function ProfileView() {
  const classes = useStyles();

  const dispatch = useDispatch();

  const profileResponse = useSelector(state=>state.userDetails.userProfile);

  useEffect(() => {
    dispatch(LoadProfileAction());
      return () => {
      
      };
  }, [dispatch])

  return (
    <div className={classes.fullWidthProfile}>
      <Card>
        {
          profileResponse !== "" && profileResponse !== null && profileResponse.success === true ?
          <div>
            <Avatar alt={profileResponse.data.name} 
                    src="/static/images/avatar/1.jpg" 
                    className={classes.large}
            />
            <Typography variant="h5" component="h2" gutterBottom>
            Nome: {profileResponse.data.name}
            Email: {profileResponse.data.email}
            Cpf: {profileResponse.data.cpf}
            Endereço:{profileResponse.data.address}
            </Typography>
          </div>
          :
          <div>Carregando dados...</div>
        }
      </Card>
    <div className={classes.linkContainer}>
      <Link to="/user/address">Cadastrar Endereço</Link>
    </div>
</div>
  );
}
